#include<iostream>
using namespace std;


int main() {
    /* Enter your code here. Read input from STDIN. Print output to STDOUT */
    int t=0;
    cin>>t;
    while(t>0){
        int build, coin, pass;
        cin>>build>>coin>>pass;
        int building[build];
        for(int i=0; i<build;i++){
            cin>>building[i];
        }
        int current=0;
        while(((coin>0 || pass>0) || (building[current]>=building[current+1])) && current<build-1){
            if(building[current]>=building[current+1]){}
            else{
                if(coin<0 && pass>0){
                    pass--;
                }
                else{
                int diff = building[current+1]-building[current];
                    bool t=true;
                if(pass<=0){t = false;}
                    for(int i=current+1, total=diff;i<=(build-2) && t;i++){
                        if(building[i+1]<=building[i]){
                            continue;
                        }
                        total+=building[i+1]-building[i];
                                                    // cout<<"total "<<total<<endl;
                        if(total-(building[i+1]-building[i])>coin){
                                                     // cout<<"break "<<i<<endl;
                                break;
                            }
                        if((building[i+1]-building[i])>=diff){
                                                    // cout<<"false "<<building[i+1]-building[i]<<endl;
                            t=false;
                                                        // cout<<"t became: "<<t<<endl;
                        }
                    }
                if(t && pass>0){
                    pass--;
                                                cout<<"pass "<<current<<" "<< coin<<" "<<diff<<endl;
                }
                else{
                    coin-=diff;
                                                cout<<"coin "<<current<<" "<< coin<<" "<<diff<<endl;
                    if(coin<0){
                        if(pass>0){
                        pass--;
                        }
                        else{
                            break;
                        }
                    }
                }
                }
            }
            current++;
        }
        cout<<current<<endl;
    t--;
    }
    return 0;
}

